    <div className="App">
      <header className="App-header">
        <ul>
        <p>COE Coffee </p><br></br>

          <p> keeping you nostalgically caffinated, wherever you are</p>
          </ul>


      </header>
      <Main/>

      <div className ="render">

    </div>
    </div>

  );
}

export default App;
